import React from "react";
import '../css/Header.css'
import Logo from '../img/informatic tree.png';
import Usuario from '../img/account_circle_FILL0_wght400_GRAD0_opsz48.png';
import Carrito from '../img/shopping_cart_FILL0_wght400_GRAD0_opsz48.png'
import Nosotros from '../sobre-nosotros';
import {Link} from 'react-router-dom';

function Header(props)
{

    return(
        <div className="Header">
            <a class="logo" href="../App.js"><img src={Logo} alt="logo" /></a>
            <nav class="navegador-header contenedor">
                <Link to=".">Tienda</Link>
                <a href="../productos.js">Tienda</a>
                <Link to="../terminos-y-condiciones.js"></Link>
                <a href="../terminos-y-condiciones.js">Terminos</a>
                <a href={Nosotros}>Nosotros</a>
                <a href="../contacto.js">Soporte</a>
            </nav>
            <div class="logos-header">
                <img src={Usuario} alt=""></img>
                <img src={Carrito} alt=""></img>
            </div>
        </div>
    );
}

export default Header;
